import { Paper, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

export const Destinations = () => {
  return (
    <Box sx={{
        display: "flex",
        justifyContent: "center",
        height: "100vh"
    }}>
        <Paper elevation={6} />
        <Paper />
    </Box>
  )
}
